import React from 'react';

function PlaceOrder() {
  return (
    <div>
      <h2>Place Order</h2>
      <ul>
        <li>Select Fertilizer</li>
        <li>Enter Quantity</li>
        <li>Confirm Order</li>
      </ul>
    </div>
  );
}

export default PlaceOrder;
